import React from "react";
import axios from "axios";
import { useState } from "react";
import { useNavigate } from "react-router";
import { useParams } from "react-router";
import { useEffect } from "react";
import Main from "./main";
import './simple.css'

function Insertdata(props){
    return(
        <div>
 <Main ad='Addcontest' page='Result'  home='/main' votehere='/votehere' card={<Data />}   />
        </div>
    )
}

export default Insertdata


function Data(props){

    const [pcount, setpcount] = useState('');
    const [pname, setpname] = useState('');
    const [cancount, setcancount] = useState('');

    useEffect(()=>{
        axios.get("http://localhost:8000/reg/positioncount").then((res) => {
          setpcount(res.data.pcount);
        
          
      });
    },[]);
    return(
        

<div class="section">
		<div class="container">
			<div class="row full-height justify-content-center">
				<div class="col-12 text-center align-self-center py-5">
					<div class="section pb-5 pt-5 pt-sm-2 text-center">
						<h6 class="mb-0 pb-3"><span></span><span></span></h6>
			    
			          	<label for="reg-log"></label>
						<div class="card-3d-wrap mx-auto">
							<div class="card-3d-wrapper">
								<div class='card-front'>
									<div class="center-wrap">
										<div class="section text-center">
                                            <form >
											<h4 class="mb-4 pb-3">{pcount}</h4>
											<div class="form-group">
												<input onChange={(event)=>{setpname(event.target.value)}} type="text" name="logemail" class="form-style" placeholder="Position Name" id="logemail" autocomplete="off" required/>
												<i class="input-icon uil uil-at"></i>
											</div>	
											<div class="form-group mt-2">
												<input onChange={(event)=>{setcancount(event.target.value)}} type="text" name="logpass" class="form-style" placeholder="Id" id="logpass" autocomplete="off" required/>
												<i class="input-icon uil uil-lock-alt"></i>
											</div>
                                            
                                            

                                    
                                    
											<a onClick='' class="btn mt-4">submit</a>
											
                            				<p class="mb-0 mt-4 text-center"><a href="#0" class="link">Forgot your password?</a></p>
                                            </form>
				      					</div>
			      					</div>
			      				</div>
                  </div>
                </div>
               </div>
             </div>
           </div>
         </div>
      

        </div>
    )
}
